import React from 'react';

class Footer extends React.Component{
    constructor(props){
        super(props);
    }
    render(){
        const social = <div><p><span></span><span></span><span></span></p></div>;
        const email = <div><form><input type={'text'}></input><div>Submit</div></form></div>;
        const link = <div><div>Article</div><div>Studio</div><div>Factory</div><div>Work</div><div>Team</div><div>Archive</div><div>Careers</div></div>
        const contact = <div><div><h6>Makespace Edmonton</h6><p>101,  10137 104 St NW<br/>Edmonton, Alberta,<br/>Canada, AB T5J 0Z9</p>
            <span>info@mk-spc.com</span><span>+ 1-587-813-0221</span></div>
            <div><h6>Makespace Calgary</h6><p>28th floor, 150 9th Ave SW <br/>Calgary, Alberta,<br/>Canada, AB T2P 3H9</p>
                <span>info@mk-spc.com</span><span>+ 1-587-813-0221</span></div></div>;
        const inc = <div><span>Â© 2018 Makespace Group Inc.</span></div>;
        const foot = <div>{email}{link}{contact}{inc}</div>;
        const div = <div>{social}{foot}</div>;
        return(div);
    }
}

export default Footer;
